import React, { useState, useEffect, useReducer } from 'react';
import './Main.css';
import Header from './../Header/Header'
import Person from '../../Image/beer.jpg'
import reactIcon from '../../Image/react.png'
import awsIcon from '../../Image/aws.png'
import htmlIcon from '../../Image/html5.jpg'
import cssIcon from '../../Image/css.svg'
import npmIcon from '../../Image/npm.png'
import sassIcon from '../../Image/sass.svg'
const Main = (props) => {
    const [FEflipper, FEsetFlipper] = useState(true);
    let FrontEndtools = [
        {
            Image: reactIcon,
            Name: "React"
        },
        {
            Image: awsIcon,
            Name: "AWS"
        },
        {
            Image: htmlIcon,
            Name: "HTML5"
        },
        {
            Image: cssIcon,
            Name: "CSS3"
        },
        {
            Image: npmIcon,
            Name: "npm"
        },
        {
            Image: sassIcon,
            Name: "Sass"
        },
    ]
    let tools = [
        {
            Image: reactIcon,
            Name: "React"
        },
        {
            Image: awsIcon,
            Name: "AWS"
        },
        {
            Image: htmlIcon,
            Name: "HTML5"
        },
        {
            Image: cssIcon,
            Name: "CSS3"
        },
        {
            Image: npmIcon,
            Name: "npm"
        },
        {
            Image: sassIcon,
            Name: "Sass"
        },
    ]
    let toolsIcons = []
    let toolsNames = []
    for (let i = 0; i < 6; i++) {

        toolsIcons.push(
            <div className="GridContainerImageContainter">
                <img className="GridIconImage"
                    src={tools[i].Image}>
                </img>
            </div>
        )
        toolsNames.push(
            <div className="CardBackGridGridContainerGridNameName">
                <p>{tools[i].Name}</p>
            </div>
        )

    }

    return (
        <div className="Main">
            <Header />
            <br />
            <div className="GridContainer">

                <div className="Section">

                    <h2>About Me</h2>
                    <p>
                    adipiscing bibendum est ultricies integer quis auctor elit sed vulputate mi sit amet mauris commodo quis imperdiet massa tincidunt nunc pulvinar sapien et ligula ullamcorper malesuada proin libero nunc consequat interdum varius sit amet mattis vulputate enim nulla aliquet porttitor lacus luctus accumsan tortor posuere ac ut consequat semper viverra
                    </p>


                </div>

                <div className="Section">

                    <h2>How I create my apps</h2>
                    <p>
                        I use the most
                    </p>



                    <div className="GridContainer Grid2 ButtonContainer">
                        <button className={FEflipper ? "ToolButtons" : "ToolButtons ToolButtonsSelected"}
                            onClick={() => setFEFlipper(!FEflipper)}>
                            <p>View Tools</p>
                        </button>
                        <button className={!FEflipper ? "ToolButtons" : "ToolButtons ToolButtonsSelected"}
                            onClick={() => setFEFlipper(!FEflipper)}>
                            <p>View Languages</p>
                        </button>
                    </div>

                    <div className={flipper ? "Card" : "Card CardFlipper"}
                        hover={flipper}
                    >
                        <div className="CardFlip">
                            <div className="CardFlipFront">
                                <div className="GridContainer Grid6">
                                    {toolsIcons}
                                    {toolsNames}
                                </div>
                            </div>
                            <div className="CardFlipBack CardIsGrid">
                                <div className="GridContainer Grid6">
                                    {toolsIcons}
                                    {toolsNames}

                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div >
    );




}
export default Main;
